AvgPreset.GatherOptions = function()
  -- function num : 0_0 , upvalues : AvgPreset, _ENV
  AvgPreset.BgCgFgResName = {}
  for i,v in ipairs(AvgPreset.BgResName) do
    (table.insert)(AvgPreset.BgCgFgResName, v)
  end
  for i,v in ipairs(AvgPreset.CgResName) do
    (table.insert)(AvgPreset.BgCgFgResName, v)
  end
  for i,v in ipairs(AvgPreset.FgResName) do
    (table.insert)(AvgPreset.BgCgFgResName, v)
  end
  AvgPreset.BgShakeTypeKeys = {}
  for i,v in ipairs(AvgPreset.BgShakeType) do
    (table.insert)(AvgPreset.BgShakeTypeKeys, v[1])
  end
  AvgPreset.CharEnterExitKeys = {}
  for i,v in ipairs(AvgPreset.CharEnter) do
    (table.insert)(AvgPreset.CharEnterExitKeys, v[1])
  end
  for i,v in ipairs(AvgPreset.CharExit) do
    (table.insert)(AvgPreset.CharEnterExitKeys, v[1])
  end
  AvgPreset.CharShakeTypeKeys = {}
  for i,v in ipairs(AvgPreset.CharShakeType) do
    (table.insert)(AvgPreset.CharShakeTypeKeys, v[1])
  end
  AvgPreset.FxNames = {}
  for i,v in ipairs(AvgPreset.FxResName) do
    (table.insert)(AvgPreset.FxNames, v[1])
  end
  AvgPreset.TransKeys = {}
  for i,v in ipairs(AvgPreset.Transition) do
    (table.insert)(AvgPreset.TransKeys, v[1])
  end
  AvgPreset.CharEmoji_A = {}
  AvgPreset.CharEmoji_B = {}
  for i,v in ipairs(AvgPreset.CharEmoji) do
    (table.insert)(AvgPreset.CharEmoji_A, v[2])
    ;
    (table.insert)(AvgPreset.CharEmoji_B, v[3])
  end
  AvgPreset.CharFadeEft_A = {}
  AvgPreset.CharFadeEft_B = {}
  for i,v in ipairs(AvgPreset.CharFadeEft) do
    (table.insert)(AvgPreset.CharFadeEft_A, v[1])
    ;
    (table.insert)(AvgPreset.CharFadeEft_B, v[2])
  end
  AvgPreset.BgmVol_A = {}
  AvgPreset.BgmVol_B = {}
  for i,v in ipairs(AvgPreset.BgmVol) do
    (table.insert)(AvgPreset.BgmVol_A, v[1])
    ;
    (table.insert)(AvgPreset.BgmVol_B, v[2])
  end
end

return AvgPreset

